.footer-container {
  width: 80%;
  margin: auto;
  .inner-footer {
    .row {
      .contact-us-container {
        display: flex;
        justify-content: right;
        align-items: center;
        font-size: 0.9rem;
        .row {
          .social-container {
            .icons {
              span {
                font-size: 0.9rem;
                font-weight: 500;
                line-height: 1rem;
                margin-right: 6px;
              }
              ul {
                flex-wrap: wrap;
                align-content: center;
                li {
                  border: 1px solid var(--theme-deafult);
                  width: 40px;
                  height: 40px;
                  padding: 10px 17px 1px 12px;
                  border-radius: 100%;
                  background: white;
                  margin-right: 8px;
                  margin-bottom: 8px;
                  &:hover {
                    background: var(--theme-deafult);
                    a {
                      i {
                        color: white;
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  }
}
.container-fluid {
  background: #f7f8f9;
}
.footer {
  padding-bottom: 0px;
}
